css:
@-moz-document domain("bbs.3dmgame.com") {
#nv_forum {
	background: #efefef !important;
}
body {
	min-width: 1080px;
	background: #efefef !important;
}
body,
input,
button,
select,
textarea,
a {
	font-family: Microsoft YaHei !important;
}
#hd .pipe,
#hd .h_menu a {
	color: #000000;
}
#wp {
	border-radius: 10px;
	margin-top: 10px;
	padding-bottom: 10px;
	margin-bottom: 10px;
}
#pt {
	padding-top: 10px;
}
/*导航栏*/

#pm_ntc.new {
	background-image: none;
}
.hd_table {
	border-bottom: none;
	border-top: none;
	margin-bottom: 30px;
}
body>table>tbody>tr>td {
	background-image: none;
	background-color: #fff;
	border-radius: 10px;
}
body>table>tbody>tr>td:first-child {
	display: none;
}
body>table:nth-child(9)>tbody>tr>td:nth-child(2)>table>tbody>tr>td>img {
	display: none;
}
body>table>tbody>tr>td>table {
	width: 100%;
	/*display: block;*/
	
	height: 60px;
}
/*body>table>tbody>tr>td>table>tbody{
    display:block;
}
body>table>tbody>tr>td>table>tbody>tr:first-child{
    display:block;
}*/

body>table>tbody>tr>td>table>tbody>tr:last-child {
	display: none;
}
body>table>tbody>tr>td>table>tbody>tr:first-child>td:last-child {
	float: right;
	height: 60px;
	line-height: 60px;
}
body>table>tbody>tr>td>table>tbody>tr:first-child>td:first-child>img {
	display: none;
}
body>table>tbody>tr>td>table>tbody>tr:first-child>td:first-child {
	width: 280px;
	height: 80px;
	display: block;
	float: left;
	border-radius: 0 0 20px 20px;
	background-color: #fff;
	background-repeat: no-repeat;
	background-position: 15px 8px;
	position: absolute;
	background-image: url(data:image/png;base64,);
}
body>table>tbody>tr>td>table>tbody>tr>td>strong:last-child {
	margin-right: 25px;
}
body>table>tbody>tr>td:last-child {
	display: none;
}
/* 搜索栏 */

.fastlg_fm {
	border-right: 0 !important;
	display: flex;
	align-items: center;
}
.fastlg_fm p {
	margin: 0 5px 0 5px;
	padding-top: 0px !important;
}
#hd {
	border-bottom: 0 solid #C2D5E3;
}
#hd>div {
	position: relative;
}
#hd .wp {
	margin: 0 auto;
	padding: 0;
	border-radius: 5px;
	background: none;
}
#hd .h_menu {
	margin: 0;
	padding: 0;
	border-radius: 10px;
	background: #fff;
	width: 100%;
	height: 30px;
	line-height: 30px;
}
#hd .h_menu>p {
	padding-right: 20px;
}
#hd>div {
	background: #fff;
}
#h_nv {
	position: absolute;
	width: 100%;
	top: 40px;
	margin: 0;
	height: auto;
}
#h_nv ul {
	top: 0px;
	right: 30px;
}
#h_nv li {
	background: none;
	display: inline;
	margin-left: 0px;
}
#h_nv>ul>li:first-child>a {
	border-radius: 5px 0 0 0;
	border-left: none;
	;
}
#h_nv>ul>li:last-child>a {
	border-radius: 0 5px 0 0;
	border-right: none;
}
#h_nv a {
	background: rgb(255, 255, 255) none repeat scroll 0 0;
	border-color: #b0e4ef;
	border-image: none;
	border-style: solid;
	border-width: 0;
	color: #666;
	float: left;
	height: 30px;
	line-height: 30px;
	overflow: hidden;
	padding: 0 14px;
	text-decoration: none;
	border-left: 1px solid rgb(239, 239, 239);
	border-right: 1px solid rgb(239, 239, 239);
}
#nv,
#mu {
	border-left: none;
	border-right: none;
	height: 75px;
	position: absolute;
	width: 390px;
	bottom: 0px;
	z-index: -1;
	border-radius: 10px;
	right: 10px;
}
#scbar {
	border: none !important;
	border-radius: 10px;
	/* padding-left: 20px; */
	
	background: rgb(255, 255, 255);
	margin-top: 40px;
	min-height: 45px;
	display: inline-flex;
	width: 100%;
}
#scbar>div:nth-child(1) {
	margin-left: 20px;
	min-width: 160px;
}
#scbar>div:nth-child(2) {
	min-width: 220px;
}
#scbar>div:nth-child(3)>form>table>tbody>tr>.scbar_hot_td {
	float: none;
}
#scbar div {
	height: 45px;
	line-height: 45px;
}

#scbar_hot {
	padding-left: 8px;
	height: 25px !important;
	overflow: hidden;
	line-height: 25px !important;
}

.z>form>table>tbody>tr {
	display: inline-flex;
	height: 45px;
}
.z>form>table>tbody>tr>td {
	display: inline-flex;
	height: 25px;
	float: left;
	padding: 10px 0 10px 0;
}
#hd>.wp>ul:nth-child(6) {
	left: 510px !important;
	top: 105px !important;
	margin-top: 0px;
}
#hd>.wp>ul:nth-child(7) {
	left: 290px !important;
	top: 105px !important;
}
.scbar_icon_td {
	display: none !important;
}
.scbar_txt_td {
	background: none;
}
.scbar_btn_td {
	background: none;
	width: auto;
}
.scbar_txt_td input {
	border-radius: 20px;
	padding: 0 10px 0 10px;
	border: none !important;
	height: 25px;
	background-color: #efefef;
}
.scbar_type_td a {
	border-radius: 0 20px 20px 0;
	height: 23px;
	line-height: 23px;
	border: 1px #efefef solid;
	margin-left: -10px;
	padding-left: 18px !important;
	color: #272536 !important;
	width: 60px;
}
.scbar_type_td {
	width: 60px;
	background: url(data:image/png;base64,);
	background-repeat: no-repeat;
	background-position: 0;
}
#scbar_btn {
	background-position: 0 0;
	width: 23px;
	margin-left: 10px;
	background-image: url(data:image/png;base64,);
}
/* 去广告 */

.a_h {
	display: none;
}
#cs_right_bottom {
	display: none;
}
#aimg_iG3NY {
	width: 300px;
}
.a_pt {
	display: none;
}
.a_f {
	display: none;
}
/*漂浮层*/

.wp .h_menu>p>a:nth-child(10) {
	position: fixed;
	right: 100px;
	bottom: 100px;
	display: inline-flex;
	height: 60px;
	width: 60px;
	background-color: rgb(0, 162, 210);
	border-radius: 50px;
	justify-content: center;
	align-items: flex-end;
	border: 3px solid #ffffff;
	box-shadow: 0px 0px 15px 0px #68c8e5;
	color: #fff !important;
	font-size: 14px;
	font-weight: 500;
	line-height: 26px;
	z-index: 1000;
	background-image: url(data:image/png;base64,)!important;
}
.wp .h_menu>p>.pipe:nth-child(9) {
	display: none
}
/*家长模式*/

.pct img {
	max-width: 100%;
	opacity: 0.1;
	-webkit-transition: all 0.5s ease 0s;
	-o-transition: all 0.5s ease 0s;
	transition: all 0.5s ease 0s;
}
.pct img:hover {
	opacity: 1;
	-webkit-transition: all 0.5s ease 0s;
	-o-transition: all 0.5s ease 0s;
	transition: all 0.5s ease 0s;
}

/*帖子列表*/
.tl tr:hover th, .tl tr:hover td{
	background:none;
}
.tl tr:hover{
	background-color: #F2F2F2;
}
